import './App.css';
import Navigation from './componenets/navigation/Navigation';
import Logo from './componenets/logo/Logo';
import Rank from './componenets/rank/rank'
import ImageLink from './componenets/imageLink/imageLink';
import Particles from 'react-particles-js';
import { Component } from 'react';
import Clarifai from 'clarifai';
import FaceReco from './componenets/face';

const particleOptions = {
  particles: {
    number: {
      value: 30,
      density: {
        enable: true,
        value_area: 8000
      }
    }
  }
}

//const { ClarifaiStub, grpc } = require("clarifai-nodejs-grpc");

//const stub = ClarifaiStub.grpc();

//const metadata = new grpc.Metadata();
//metadata.set("authorization", "8574ae4ec5094e459de26dbf89fe7742");

const app = new Clarifai.App({
  apiKey: '8574ae4ec5094e459de26dbf89fe7742'
});

class App extends Component {

  constructor() {
    super();
    this.state = {
      input: '',
      imageUrl: '',
    }
  }


  onInputChange = (event) => {
    this.setState({ input: event.target.value })
  }

  onButtonSubmit = () => {
    this.setState({ imageUrl: this.state.input })
    app.models.predict('53e1df302c079b3db8a0a36033ed2d15').then((response) => {
      console.log(response.output[0].data.regions[0].region_info.bounding_box);
    }
    )

  };

  pictureSubmited = () => {

  }

  render() {

    return (
      <div className="App" >

        <Particles className='particles' />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLink onInputChange={this.onInputChange} onSubmit={this.onButtonSubmit} />
        <FaceReco imageUrl={this.state.imageUrl} />

      </div>
    );
  }
}

export default App;
